description:
Verenigd Koninkrijk / Duitsland / Verenigde Staten
Komedie / Avontuur
99 minuten

een goeie film

met Robin Williams, Cheryl Hines en Jeff Daniels

Bob Munro is een man met een drukke baan, die op een dag abrupt met zijn gezin vertrekt in een camper richting Colorado. Het 
beloven twee verrassende weken te worden, alleen weten ze niet dat Bob naar Colorado is gegaan voor zaken. Ze zijn nu twee weken 
lang op elkaar aangewezen...
